import React from "react";

const FullRecord = (props) => {
    return (
        <div style={{border: '1px solid rgba(0, 0, 100, 0.5)', margin: '10px'}}>
            <strong>Имя: </strong> {props.rec.full_name}, <strong>телефон:</strong> {props.rec.phone}, <strong>email: </strong> {props.rec.email} <br />
            <strong>Город: </strong> {props.rec.city}, <strong>улица:</strong> {props.rec.street}, <strong>дом:</strong> {props.rec.house}, 
            <strong>подъезд:</strong>, {props.rec.entrance}, <strong>этаж:</strong> {props.rec.floor}, <strong>квартира:</strong> {props.rec.office}, <strong>домофон:</strong> {props.rec.door_code}
        </div>
    );
};

export default FullRecord;
